faciliteter.</p>'),(460,'intro_text','intro_right1','<p>Siden 2014 har Bible Online Learner vre en del af <a href=\"http://global-learning.org\"\n    target=\"_blank\">Global Learning Initiative</a>. Yderligere oplysnigner fs hos professor Nicolai\n    Winther-Nielsen (nwn [at] dbi . edu) hos <a href=\"http://fih.fjellhaug.no\"\n    target=\"_blank\">Fjellhaug International University College Denmark (FIUC-DK)</a>.<br>\n\n    Bible Online Learner blev udviklet af Claus Tndering fra <a href=\"http://www.ezer.dk\"\n    target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n    For sit PhD-studium ved Aalborg universitet udvikler Judith Gottschalk <i>Learning Journey,</i>\n    en plugin som giver statistiske oplysninger om\n    hvorledes studerende klarer sig i Bible OL.</p>'),(461,'intro_text','intro_right2','<p>Bible Online Learner er baseret p PLOTLearner, et PC-program der blev udklet som en del af <a\n    href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT-projektet</a> i 2010-2013. Nrvrende\n    websted er resultatet af videre udvikling foretaget af Ezer IT Consulting uden for\n    EuroPLOT-projektet. Webstedet vedligeholdes af <a href=\"http://3bmoodle.dk\" target=\"_blank\">3BM\n    Bible Software and Multimedia</a>.</p>'),(462,'intro_text','intro_right3','<p>SHEBANQ-webstedet blev skabt af Wido van Peursen og Dirk Roorda.</p>'),(463,'intro_text','intro_right_head','Bible Online Learner &ndash; fri global lring'),(464,'intro_text','welcome','Velkommen til Bible Online Learner'),(465,'intro_text','welcome2','%s, velkommen til Bible Online Learner'),(466,'privacy','privacy_policy_title','Privatlivspolitik'),(467,'privacy','privacy_text','<h1>Privatlivspolitik</h1>\n\n     <p>Denne privatlivspolitik fastlgger hvordan Bible Online Learner benytter og beskytter de oplysninger\n     som du angiver nr du bliver registreret p dette websted.</p>\n\n     <p>Du kan bruge visse funktioner p dette websted uden at registrere dig. I s fald indsamler vi ingen\n     personlige oplysninger om dig.</p>\n\n     <h2>Hvad indsamler vi?</h2>\n     <p>Hvis du fr en konto p dette websted, indsamle vi flgende oplysninger:</p>\n\n     <ul>\n       <li>Navn</li>\n       <li>Email-adresse</li>\n     </ul>\n\n     <p>Disse oplysninger benyttes udenlukkede for at</p>\n     <ul>\n       <li>identificere dig nr du benytter webstedet,</li>\n       <li>om ndvendigt sende dig emails om webstedets tilstand.</li>\n     </ul>\n\n     <p>Vi videregiver ikke dine oplysninger til tredjepart til brug for markedsfring eller reklame,\n     og vi slger ikke dine oplysninger.</p>\n\n     <h2>Hvordan sletter du din konto?</h2>\n\n     <p>Du kan slette din konto p dette websted ved at vlge menupunktet Profil under Mine data\n     og derp klikke p knappen Nedlg profilen. Dette vil fjerne alle oplysninger om dit navn og din\n     email-adresse fra dette websted.</p>\n\n     <h2>Links til andre websteder</h2>\n\n     <p>Vores websted kan indeholde links der gr det let for dig at besge andre interessante websteder.\n     Men s snart et sdant link har frt dig vk fra vores websted, skal du vre opmrksom p at vi ikke\n     har nogen kontrol over det andet websted. Vi er derfor ikke ansvarlige for hvad der sker hvis du\n     dr giver private oplysninger, og sdanne websteder er ikke underlagt nrvrende privatlivspolitik.\n     Du br vre forsigtig og undersge hvilke privatlivsregler der glder for disse andre websteder.</p>'),(468,'common','already_logged_in','Du er allerede logget ind'),(469,'common','cancel_button','Annullr'),(470,'common','cannot_open_file','Kan ikke bne filen: %s'),(471,'common','close_button','Luk'),(472,'common','date_time_format','d.m.Y H:i'),(473,'common','error_colon','Fejl:'),(474,'common','facebook_no_valid_reply','Intet gyldigt svar fra Facebook'),(475,'common','field_required','(Skal udfyldes)'),(476,'common','google_no_valid_reply','Intet gyldigt svar fra Google'),(477,'common','illegal_class_id','Ugyldig klasse-ID'),(478,'common','illegal_user_id','Ugyl