 to jump directly to that chapter on their website. Furthermore,\n       facilitators can use queries from SHEBANQ to generate exercises in Bible OL.</p>\n\n       <p>The source code for Bible OL is available at <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. We hope developers will fork this code and join us to add\n       additional features.</p>'),(460,'intro_text','intro_right1','<p>Since 2014, Bible Online Learner has been part of the <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. For more information, please contact Professor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) of <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n\n       Bible Online Learner was developed by Claus Tndering of <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       For her PhD at Aalborg University, Judith Gottschalk is developing <i>Learning Journey,</i>\n       a plugin with statistics on learner performance.</p>'),(461,'intro_text','intro_right2','<p>Bible Online Learner is based on PLOTLearner, a PC program developed as part of the\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a> project 2010-2013. The\n       present website is the result of further development by Ezer IT Consulting outside the\n       EuroPLOT project, and the site is maintained by <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(462,'intro_text','intro_right3','<p>The SHEBANQ web site was created by Wido van Peursen and Dirk Roorda.</p>'),(463,'intro_text','intro_right_head','Bible Online Learner for Free Global Learning'),(464,'intro_text','welcome','Welcome to Bible Online Learner'),(465,'intro_text','welcome2','%s, welcome to Bible Online Learner'),(466,'privacy','privacy_policy_title','Privacy Policy'),(467,'privacy','privacy_text','<h1>Privacy Policy</h1>\n\n     <p>This privacy policy sets out how Bible Online Learner uses and protects any information that you\n     provide when you register at this website.</p>\n\n     <p>You can you some functions on the website without registering. In that case, we collect no\n     personal information about you.</p>\n\n\n     <h2>What we collect</h2>\n     <p>If you set up an account on this website, we may collect the following information:</p>\n\n     <ul>\n       <li>Name</li>\n       <li>Email address</li>\n     </ul>\n\n     <p>This information is only used for the purpose of</p>\n     <ul>\n       <li>identifying you when you use the website,</li>\n       <li>if necessary, send you emails about the status of this website.</li>\n     </ul>\n\n     <p>We will not provide your information to a third party for marketing or promotional purposes, nor\n     will we sell your information.</p>\n\n     <h2>Deleting your account</h2>\n\n     <p>You can delete your account on this website by selecting the Profile menu item from the\n     My Data menu and then clicking the button labelled Delete the profile. This will remove all\n     information about your name and email address from this website.</p>\n\n     <h2>Links to other websites</h2>\n\n     <p>Our website may contain links to enable you to visit other websites of interest easily. However,\n     once you have used these links to leave our site, you should note that we do not have any control\n     over that other website. Therefore, we cannot be responsible for the protection and privacy of any\n     information which you provide whilst visiting such sites and such sites are not governed by this\n     privacy statement. You should exercise caution and look at the privacy statement applicable to the\n     website in question.</p>'),(468,'common','already_logged_in','You are already logged in'),(469,'common','cancel_button','Cancel'),(470,'common','cannot_open_file','Cannot open file: %s'),(471,'common','close_button','Close'),(472,'common','date_time_format','dMY H:i'),(473,'common','error_colon','Error:'),(474,'common','facebook_no_valid_reply','No valid reply from Facebook'),(475,'common','field_required','(Required)'),(476,'common','google_no_valid_reply','No valid reply from Google'),(477,'common','illegal_class_id','Illegal class ID'),(478,'common','illegal_user_id','Illegal user ID'),(479,'common','language','Language'),(480,'common','missing_folder_name','Missing folder name'),(481,'common','missing_quiz_filename','Missing quiz filename'),(482,'common','must_be_admin','You must be logged in as administrator to access this function'),(483,'common','must_be_facebook','You must be logged in with Facebook to access this function'),(484,'common','must_be_google','You must be logged in with Google to access this function'),(485,'common','must_be_logged_in','You must be logged in to access this function'),(486,'common','must_be_teacher','You must be logged in as facilitator to access this function'),(487,'common','must_be_translator','You must be logged in as translator to access this function'),(488,'common','must_not_be_facebook','You must not be logged in with Facebook to access this function'),(489,'common','must_not_be_google','You must not be logged in with Google to access this function'),(490,'common','no','No'),(491,'common','OK_button','OK'),(492,'common','swipe','If your display is not wide enough to show a complete column in the table, you can swipe each column left and right.'),(493,'common','this_is_folder','This Is the Folder \'%s\''),(494,'common','this_is_top_folder','This Is the Top Folder'),(495,'common','time_format','H:i'),(496,'common','yes','Yes'),(497,'font','alphabet_greek','Greek'),(498,'font','alphabet_hebrew','Hebrew'),(499,'font','alphabet_hebrew_translit','transliterated Hebrew'),(500,'font','alphabet_latin','Latin'),(501,'font','bold','Bold'),(502,'font','configure_font','Configure your font preferences'),(503,'fo