n este cdigo y se unan a nosotros para adicionar\n       caractersticas adicionales.</p>'),(451,'intro_text','intro_right1','<p>Desde el 2014, Bible Online Learner ha sido parte de <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para ms informacin, por favor contacte Profesor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n\n       Bible Online Learner fue desarrollado por Claus Tndering of <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para su Doctorado en Aalborg University, Judith Gottschalk est desarrollando <i>Learning Journey,</i>\n       una adicin con estadsticas en el rendimiento del estudiante.</p>'),(452,'intro_text','intro_right2','<p>Bible Online Learner est basado en PLOTLearner, un programa de desarrollado como parte del proyecto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a> 2010-2013. El\n       presente sitio web es el resultado de major desarrollo por Ezer IT Consulting fuera del proyecto\n       EuroPLOT, y el sitio web es mantenido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(453,'intro_text','intro_right3','<p>El sitio web SHEBANQ fue creado por Wido van Peursen and Dirk Roorda.</p>'),(454,'intro_text','intro_right_head','Bible Online Learner para un Aprendizaje Global Gratuito'),(455,'intro_text','welcome','Bienvenido Bible Online Learner'),(456,'intro_text','welcome2','%s, bienvenido a Bible Online Learner'),(457,'privacy','privacy_policy_title','Pliza de Privacidad'),(458,'privacy','privacy_text','<h1>Pliza de Privacidad</h1>\n\n     <p>Esta pliza de privacidad establece como Bible Online Learner usa and proteje cualquier informacin que t\n     provees cuando te registras en este sitio web.</p>\n\n     <p>Usted puede usar algunas funciones en este sitio web sin tener que registrarse. En ese caso, no colectamos\n     informacin personal acerca de t.</p>\n\n\n     <h2>Que colectamos</h2>\n     <p>Si estableces una cuenta en este sitio web, puede que colectemos la siguiente informacin:</p>\n\n     <ul>\n       <li>Nombre</li>\n       <li>Correo Electrnico</li>\n     </ul>\n\n     <p>Esta informacin es usada solamente para el prposito de</p>\n     <ul>\n       <li>identificarte cuando usas el sitio web,</li>\n       <li>si es necesario, enviarte correo electrnicos acerca del estado de este sitio web.</li>\n     </ul>\n\n     <p>No proporcionaremos tu informacin a terceras personas para venta o prpositos promocionales, ni\n     venderemos tu informacin.</p>\n\n     <h2>Eliminar tu cuenta</h2>\n\n     <p>Usted puede eliminar su cuenta en este sitio web seleccionando el men Perfil del \n     men Mi informacin y luego haga click al botn etiquetado Eliminar el perfil. Esto remover toda\n     informacin acerca de tu nombre y correo electrnico en este sitio web.</p>\n\n     <h2>Enlaces a otros sitios web.</h2>\n\n     <p>Nuestro sitio web contiene enlaces te ayudan a visitar otros sitios web de fcil inters. Sin embargo,\n     una vez que hayas usado estos enlaces para abandonar nuestro sitio, usted debe notar que no tenemos control\n     sobre ese otro sitio web. Por lo tanto, no podemos ser responsable por la proteccin y privacidad de la\n     informacin que provees mientras visitas tales sitios and esos sitios no estan governados por esta \n     declaracin de privacidad. Usted debe de ejercitar cuidado y leer la declaracin de privacidad aplicable al\n     sitio web en pregunta.</p>'),(459,'common','already_logged_in','Usted ya ha iniciado sesin'),(460,'common','cancel_button','Cancelar'),(461,'common','cannot_open_file','No se puede abrir el archivo: %s'),(462,'common','close_button','Cerrar'),(463,'common','date_time_format','dMA H:i'),(464,'common','error_colon','Error:'),(465,'commo