nto da verso de 1904 de Nestle com anotaes gramaticais;\n       ademais, professors podem user os exerccios desenvolvidos para o Bible OL ou criar os seus prprios exerccios.</p>\n\n       <p>Bible OL est inter-conectado ao premiado website de testes em Hebraico e de exibio de texto <a\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>. A partir de um captulo no website Bible\n       OL, clique no logo do SHEBANQ para ser redirecionado diretamente para o mesmo captulo neste website. Ademais,\n       professores podem usar perguntas criadas no website SHEBANQ para gerar exerccios no Bible OL.</p>\n\n       <p>O cdigo-fonte para o Bible OL est disponvel em <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. Nosso desejo  que outros programadores trabalhem com este cdigo e se juntem a ns para desenvolver\n       caractersticas adicionais.</p>'),(447,'intro_text','intro_right1','<p>Desde 2014, o Bible Online Learner  parte do <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para mais informaes, por favor faa contato com o Professor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n             \n       Bible Online Learner foi desenvolvido por Claus Tndering de <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para seu PhD em Aalborg University, Judith Gottschalk est desenvolvendo <i>Learning Journey,</i>\n       um plugin com estatsticas sobre performance de aprendizado.</p>'),(448,'intro_text','intro_right2','<p>Bible Online Learner  baseado em PLOTLearner, um programa de PC desenvolvido como parte do projeto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a>, 2010-2013. O\n       presente website  resultado de desenvolvimento posterior feito por Ezer IT Consulting fora do projeto\n       EuroPLOT, e o site  mantido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(449,'intro_text','intro_right3','<p>O website SHEBANQ foi criado por Wido van Peursen e Dirk Roorda.</p>'),(450,'intro_text','intro_right_head','Bible Online Learner por um movimento global de aprendizado gratuito'),(451,'intro_text','welcome','Bem-vindo ao Bible Online Learner'),(452,'intro_text','welcome2','%s, bem-vindo ao Bible Online Learner'),(453,'privacy','privacy_policy_title','Poltica de Privacidade'),(454,'privacy','privacy_text','<h1>Poltica de Privacidade</h1>\n\n     <p>Essa poltica de privacidade delimita como o Bible Online Learner usa e protege qualquer informao que voc \n     prov quando se registra neste website.</p>\n\n     <p>Voc pode usar algumas funes deste website sem se registrar. Neste caso, ns no coletamos\n     qualquer informao pessoal sua.</p>\n\n\n     <h2>Aquilo que ns coletamos</h2>\n     <p>Se voc fizer uma conta neste website, ns poderemos coletar as seguintes informaes:</p>\n\n     <ul>\n       <li>Nome</li>\n       <li>Endereo de email</li>\n     </ul>\n\n     <p>Essa informao  somente usada para</p>\n     <ul>\n       <li>identificar voc quando voc usar o website,</li>\n       <li>se necessrio, envi-lo emails sobre o status deste website.</li>\n     </ul>\n\n     <p>Ns no forneceremos suas informaes  uma terceira parte para uslas em marketing ou propsitos promocionais. Ns\n     no venderemos as suas informaes.</p>\n\n     <h2>Deletando sua conta</h2>\n\n     <p>Voc pode deletar sua conta neste website ao selecionar o item de menu Perfil no\n     menu Minhas Informaes e ento clicar no boto Deletar o Perfil. Isso remover todas as \n     informaes sobre o seu nome e endereo de email deste website.</p>\n\n     <h2>Links para outros websites</h2>\n\n     <p>Nosso website pode conter links para habilit-lo  visitar outros websites de interesse facilmente. Contudo,\n     uma vez que voc utilizar esses links para deixar nosso site, voc deveria notar que ns no temos nenhum controle\n     sobre outros websites. Portanto, ns no podemos ser responsveis pela proteo e privacidade de nenhuma informao\n     que voc fornecer enquanto estiver visitando tais sites. Ademais, estes sites no so governados por esta\n     declarao de privacidade. Voc deve exercer cautela e checar a de clarao de privacidade aplicvel ao\n     website em questo.</p>'),(455,'common','already_logged_in','Voc j est logado'),(456,'common','cancel_button','Cancelar'),(457,'common','cannot_open_file','O arquivo %s no pode ser aberto'),(458,'common','close_button','Fechar'),(459,'common','date_time_format','dMY H:i'),(460,'common','error_colon','Erro:'),(461,'common','facebook_no_valid_reply','Resposta invlida do Facebook'),(462,'common','field_required','(Necessrio)'),(463,'common','google_no_valid_reply','Nenhuma resposta vlida do Google'),(464,'common','illegal_class_id','Identificao de Classe Ilegal'),(465,'common','illegal_user_id','Identificao de Usurio Ilegal'),(466,'common','language','Lngua'),(467,'common','missing_folder_name','Nome da pasta faltando'),(468,'common','missing_quiz_filename','Nome de arquivo do quiz faltando'),(469,'common','must_be_admin','Voc precisa entrar como administrador para acessar esta funo'),(470,'common','must_be_facebook','Voc precisa entrar com o Facebook para acessar esta funo'),(471,'common','must_be_google','Voc precisa entrar com o Google para acessar esta funo'),(472,'common','must_be_logged_in','Voc precisa entrar para acessar esta funo'),(473,'common','must_be_teacher','Voc precisa entrar como facilitador para acessar esta funo'),(474,'common','must_not_be_facebook','Voc precisa no entrar com o Facebook para acessar esta funo'),(475,'common','must_not_be_google','Voc no precisa entrar com o Google para acessar esta funo'),(476,'common','no','No'),(477,'common','OK_button','OK'),(478,'common','swipe','Se o seu display/tela no  s